package com.scar.tugasrecycleview;

import java.util.ArrayList;

public class NegaraData {
    public static String [][] data = new String[][]{
            {"Indonesia", "Republik Indonesia atau Negara Kesatuan Republik Indonesia, atau lebih umum disebut Indonesia, adalah negara di Asia Tenggara yang dilintasi garis khatulistiwa dan berada di antara daratan benua Asia dan Australia, serta antara Samudra Pasifik dan Samudra Hindia.", "data:image/png;base64,"},
            {"Kamboja", "Kerajaan Kamboja adalah sebuah negara berbentuk monarki konstitusional di Asia Tenggara. Negara ini merupakan penerus Kekaisaran Khmer yang pernah menguasai seluruh Semenanjung Indochina antara abad ke-11 dan 14.", "data:image/png;base64,"},
            {"Thailand", "Kerajaan Thai, yang lebih sering disebut Thailand dalam bahasa Inggris, atau dalam bahasa aslinya Mueang Thai, adalah sebuah negara di Asia Tenggara yang berbatasan dengan Laos dan Kamboja di timur, Malaysia dan Teluk Siam di selatan, dan Myanmar dan Laut Andaman di barat.", "data:image/png;base64,"},
            {"Vietnam", "Vietnam, bernama resmi Republik Sosialis Vietnam adalah negara paling timur di Semenanjung Indochina di Asia Tenggara. Vietnam berbatasan dengan Republik Rakyat Tiongkok di sebelah utara, Laos di sebelah barat laut, Kamboja di sebelah barat daya dan di sebelah timur terbentang Laut China Selatan.", "data:image/png;base64,"},
            {"Brunei Darussalam", "Brunei Darussalam atau Brunei, nama resmi: Negara Brunei Darussalam, adalah negara berdaulat di Asia Tenggara yang terletak di pantai utara pulau Kalimantan. Negara ini memiliki wilayah seluas 5.765 kmÂ² yang menempati pulau Borneo dengan garis pantai seluruhnya menyentuh Laut Cina Selatan. ", "data:image/png;base64,"},
    };

    public  static ArrayList<Negara> getListData(){
        ArrayList<Negara> list = new ArrayList<>();
        for (String[] aData : data){
            Negara negara = new Negara();
            negara.setName(aData[0]);
            negara.setDeskripsi(aData[1]);
            negara.setPhoto(aData[2]);
            list.add(negara);
        }
        return list;
    }
}
